<!DOCTYPE html>
<html lang="en">
  <head>
    <link rel="icon" href="./favicon.ico" type="image/gif" sizes="16x16" />
    <meta content="text/html;charset=utf-8" http-equiv="Content-Type" />
    <meta content="width=device-width, initial-scale=1.0" name="viewport" />
    <meta
      content="Gigaland - NFT Marketplace Website Template"
      name="description"
    />
    <meta content="" name="keywords" />
    <meta content="" name="author" />
    <!--
      manifest.json provides metadata used when your web app is installed on a
      user's mobile device or desktop. See https://developers.google.com/web/fundamentals/web-app-manifest/
    -->
    <link rel="manifest" href="%PUBLIC_URL%/manifest.json" />
    <!--
      Notice the use of %PUBLIC_URL% in the tags above.
      It will be replaced with the URL of the `public` folder during the build.
      Only files inside the `public` folder can be referenced from the HTML.

      Unlike "/favicon.ico" or "favicon.ico", "%PUBLIC_URL%/favicon.ico" will
      work correctly both with client-side routing and a non-root public URL.
      Learn how to configure a non-root public URL by running `npm run build`.
    -->
    <link
      id="bootstrap"
      href="./css/bootstrap.min.css"
      rel="stylesheet"
      type="text/css"
    />
    <link
      id="bootstrap-grid"
      href="./css/bootstrap-grid.min.css"
      rel="stylesheet"
      type="text/css"
    />
    <link
      id="bootstrap-reboot"
      href="./css/bootstrap-reboot.min.css"
      rel="stylesheet"
      type="text/css"
    />
    <link rel="stylesheet" type="text/css" href="./css/animate.css" />
    <link rel="stylesheet" type="text/css" href="./css/de-grey.css" />
    <link rel="stylesheet" type="text/css" href="./css/magnific-popup.css" />
    <link rel="stylesheet" type="text/css" href="./css/owl.carousel.css" />
    <link rel="stylesheet" type="text/css" href="./css/owl.theme.css" />
    <link rel="stylesheet" type="text/css" href="./css/owl.transitions.css" />
    <link rel="stylesheet" type="text/css" href="./css/style.css" />
    <link
      id="colors"
      href="./css/colors/scheme-01.css"
      rel="stylesheet"
      type="text/css"
    />
    <link href="./css/coloring.css" rel="stylesheet" type="text/css" />

    <title>ICICB NFT marketplace</title>
  </head>
  <body class="dark-scheme de-grey">
    <noscript>You need to enable JavaScript to run this app.</noscript>
    <div id="wrapper"></div>

    -->
    <script src="./js/jquery.min.js"></script>
    <script src="./js/bootstrap.min.js"></script>
    <script src="./js/bootstrap.bundle.min.js"></script>
    <script src="./js/wow.min.js"></script>
    <script src="./js/jquery.isotope.min.js"></script>
    <script src="./js/easing.js"></script>
    <script src="./js/owl.carousel.js"></script>
    <script src="./js/validation.js"></script>
    <script src="./js/jquery.magnific-popup.min.js"></script>
    <script src="./js/enquire.min.js"></script>
    <script src="./js/jquery.plugin.js"></script>
    <script src="./js/jquery.countTo.js"></script>
